import React, { useState } from "react"
import 'bootstrap/dist/css/bootstrap.min.css';
import {Nav, Navbar, Container, NavDropdown} from 'react-bootstrap/'
import "./StyleHeader.css"
import { useHistory } from "react-router";
import { useSelector } from "react-redux";

const mapStateToProps = {

}

export default function NavBar(){
  const history = useHistory();

  const email = useSelector((state) => state.setAuth.email)

  const [isAuth, setisAuth] = useState(false)

  const state = useSelector((state) => state)
  let auth = useSelector((state) => state.enterReducer.isAuth)

  console.log(auth)

//  console.log(state.reducer.success)


  if(state.reducer.success){
   setisAuth(true)
  }

  return(

      <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
        <Container>
          <Navbar.Brand onClick={() => history.push('/startp')}>startUP! Factory</Navbar.Brand>
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">

           { isAuth ?  (
                < >
                 <Nav className="me-auto">
                  <Nav.Link onClick={() => history.push('/project')}>Projects</Nav.Link>
                  <Nav.Link onClick={() => history.push('/tracker')}>Tracker</Nav.Link>
                  <Nav.Link onClick={() => history.push('/create')}>Create</Nav.Link>
                  <Nav.Link onClick={() => history.push('/story')}>Story</Nav.Link>


                <NavDropdown title={email} id="collasible-nav-dropdown">
                  <NavDropdown.Item onClick={() => history.push('/project')}>Projects</NavDropdown.Item>
                  <NavDropdown.Item onClick={() => history.push('/tracker')}>Tracker</NavDropdown.Item>
                  <NavDropdown.Item onClick={() => history.push('/create')}>Create</NavDropdown.Item>
                  <NavDropdown.Item onClick={() => history.push('/story')}>Story</NavDropdown.Item>
                  <NavDropdown.Divider />
                  <NavDropdown.Item onClick={() => window.location.replace("/")}>Logout</NavDropdown.Item>
                </NavDropdown>                 
       </Nav>
                </>

            ) : (              
              <>
              <Nav className="me-auto"></Nav>
               <Nav>
                  <Nav.Link onClick ={()=> history.push('/login')}>Sign in</Nav.Link>
                  <Nav.Link onClick ={()=> history.push('/auth')}>Sign up</Nav.Link>
                </Nav>
              </>
            )
            }

           </Navbar.Collapse>
        </Container>
      </Navbar>

  ) 
}
